import { useState } from "react";
import "./styles.css";
import Home from "./pages/Home";
import Login from "./pages/Login";
import HealthChat from "./pages/HealthChat";
import NearbyFinder from "./pages/NearbyFinder";
import Navbar from "./components/Navbar";
import EmergencyAlert from "./components/EmergencyAlert";
import AppointmentLetter from "./components/AppointmentLetter";
import Feedback from "./components/Feedback";
import { LanguageProvider } from "./context/LanguageContext";
import { AuthProvider } from "./context/AuthContext";
import AdminLogin from "./pages/AdminLogin";

export default function App() {
  const [page, setPage] = useState("home");

  return (
    <AuthProvider>
      <LanguageProvider>
        {page !== "login" && page !== "admin" && <Navbar setPage={setPage} />}
        {
          {
            home: <Home />,
            login: <Login setPage={setPage} />,
            admin: <AdminLogin setPage={setPage} />,
            feedback: <Feedback />,
          }[page]
        }
      </LanguageProvider>
    </AuthProvider>
  );
}
